-- ----------------------------
-- Table structure for grp_crm_corp_blacklist
-- ----------------------------
DROP TABLE IF EXISTS "grp_dev"."grp_crm_corp_blacklist";
CREATE TABLE "grp_dev"."grp_crm_corp_blacklist" (
"id" int4 DEFAULT nextval('"grp_dev".grp_crm_corp_blacklist_id_seq'::regclass) NOT NULL,
"chain_uid" varchar(40) COLLATE "default" DEFAULT NULL::character varying NOT NULL,
"corp_no" varchar(40) COLLATE "default" DEFAULT NULL::character varying NOT NULL,
"status_flg" varchar(3) COLLATE "default" DEFAULT '1'::character varying NOT NULL,
"blklsttyp_id" int4 NOT NULL,
"note" varchar(500) COLLATE "default" DEFAULT NULL::character varying,
"blklstcxlrsn_id" int4,
"create_typ" varchar(3) COLLATE "default" DEFAULT NULL::character varying NOT NULL,
"created_by_uid" varchar(40) COLLATE "default" DEFAULT NULL::character varying,
"created_date" timestamp(3),
"created_by" varchar(50) COLLATE "default",
"created_by_cd" varchar(100) COLLATE "default",
"created_unit_cd" varchar(50) COLLATE "default",
"created_unit_uid" varchar(40) COLLATE "default",
"modified_by_uid" varchar(40) COLLATE "default",
"modified_date" timestamp(3),
"modified_by" varchar(50) COLLATE "default",
"modified_by_cd" varchar(100) COLLATE "default",
"modified_unit_cd" varchar(50) COLLATE "default",
"modified_unit_uid" varchar(40) COLLATE "default",
"version" int4,
"seq" int4
)
WITH (OIDS=FALSE)

;
COMMENT ON TABLE "grp_dev"."grp_crm_corp_blacklist" IS '用于记录客人是否为黑名单或通缉犯，是客史基本资料表的子表。';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."id" IS 'ID字段';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."chain_uid" IS '集团CD';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."corp_no" IS '客史号';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."status_flg" IS '状态标识1：有效（默认） 0：无效/撤销';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."blklsttyp_id" IS '类型';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."note" IS '描述';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."blklstcxlrsn_id" IS '撤销原因';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."create_typ" IS '建立方式 1：酒店 2：网站 3：线下会员系统 4：CRS';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."created_by_uid" IS '创建人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."created_date" IS '创建日';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."created_by" IS '创建人';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."created_by_cd" IS '创建人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."created_unit_cd" IS '创建人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."created_unit_uid" IS '创建人单位KEY';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."modified_by_uid" IS '修改人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."modified_date" IS '修改日';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."modified_by" IS '修改人';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."modified_by_cd" IS '修改人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."modified_unit_cd" IS '修改人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."modified_unit_uid" IS '修改人单位KEY';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_blacklist"."version" IS '版本';

