COMMENT ON COLUMN "grp_dev"."grp_crm_corp_contactway"."create_typ" IS '建立方式 1：酒店 2：网站 3：线下会员系统 4：CRS';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_contactway"."created_by_uid" IS '创建人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_contactway"."created_date" IS '创建日';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_contactway"."created_by" IS '创建人';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_contactway"."created_by_cd" IS '创建人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_contactway"."created_unit_cd" IS '创建人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_contactway"."created_unit_uid" IS '创建人单位KEY';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_contactway"."modified_by_uid" IS '修改人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_corp_contactway"."modified_date" IS '修改日';
