-- ----------------------------
-- Table structure for grp_crm_member
-- ----------------------------
DROP TABLE IF EXISTS "grp_dev"."grp_crm_member";
CREATE TABLE "grp_dev"."grp_crm_member" (
"id" int4 DEFAULT nextval('"grp_dev".grp_crm_member_id_seq'::regclass) NOT NULL,
"chain_uid" varchar(40) COLLATE "default",
"unit_uid" varchar(40) COLLATE "default",
"profile_no" varchar(40) COLLATE "default",
"seq" int4,
"status_flg" varchar(1) COLLATE "default",
"member_stat" varchar(1) COLLATE "default",
"membertyp_id" int4,
"memberrank_id" int4,
"loginphone_ctno" varchar(100) COLLATE "default",
"loginemail_ctno" varchar(100) COLLATE "default",
"login_cd" varchar(20) COLLATE "default",
"certificatetyp_id" int4,
"certificate_idcd" varchar(100) COLLATE "default",
"login_pwd" varchar(100) COLLATE "default",
"primary_flg" varchar(1) COLLATE "default",
"lastconsume_date" date,
"consume_amount" numeric(12,4),
"consume_times" numeric(12,4),
"consume_nights" numeric(12,4),
"jointyp_id" int4,
"referrer" varchar(40) COLLATE "default",
"saler_id" int4,
"referorg" varchar(40) COLLATE "default",
"join_date" date,
"validst_date" date,
"valided_date" date,
"quit_date" date,
"quitreason_id" int4,
"note" varchar(500) COLLATE "default",
"created_by_uid" varchar(40) COLLATE "default",
"created_date" timestamp(6),
"created_by" varchar(50) COLLATE "default" DEFAULT NULL::character varying,
"created_by_cd" varchar(20) COLLATE "default" DEFAULT NULL::character varying,
"created_unit_uid" varchar(40) COLLATE "default" DEFAULT NULL::character varying,
"created_unit_cd" varchar(20) COLLATE "default" DEFAULT NULL::character varying,
"modified_by_uid" varchar(40) COLLATE "default",
"modified_date" timestamp(6),
"modified_by" varchar(50) COLLATE "default" DEFAULT NULL::character varying,
"modified_by_cd" varchar(100) COLLATE "default" DEFAULT NULL::character varying,
"modified_unit_uid" varchar(40) COLLATE "default" DEFAULT NULL::character varying,
"modified_unit_cd" varchar(20) COLLATE "default" DEFAULT NULL::character varying,
"version" int4,
"create_typ" varchar(3) COLLATE "default"
)
WITH (OIDS=FALSE)

;
COMMENT ON TABLE "grp_dev"."grp_crm_member" IS '会员信息';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."id" IS 'ID字段';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."status_flg" IS '1有效，0无效';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."member_stat" IS '1-入会；2-退会；3-冻结；4-过期；3和4只是针对有会员卡号，一期不涉及';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."primary_flg" IS '1表示主记录';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."consume_amount" IS '冗余字段';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."referrer" IS '销售员还是职员？';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."saler_id" IS '对应销售员代码';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."referorg" IS '对应什么？法人？';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."created_by_uid" IS '创建人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."created_date" IS '创建日';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."created_by" IS '创建人';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."created_by_cd" IS '创建人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."created_unit_uid" IS '创建人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."created_unit_cd" IS '创建人单位KEY';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."modified_by_uid" IS '修改人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."modified_date" IS '修改日';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."modified_by" IS '修改人';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."modified_by_cd" IS '修改人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."modified_unit_uid" IS '修改人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."modified_unit_cd" IS '修改人单位KEY';
COMMENT ON COLUMN "grp_dev"."grp_crm_member"."version" IS '版本';

