DROP TABLE IF EXISTS "grp_dev"."grp_crm_profile";
CREATE TABLE "grp_dev"."grp_crm_profile" (
"id" int4 DEFAULT nextval('"grp_dev".crm_profile_id_seq'::regclass) NOT NULL,
"chain_uid" varchar(40) COLLATE "default" NOT NULL,
"profile_no" varchar(40) COLLATE "default" NOT NULL,
"status_flg" varchar(3) COLLATE "default" DEFAULT '1'::character varying NOT NULL,
"profile_typ" varchar(3) COLLATE "default" NOT NULL,
"first_nm" varchar(100) COLLATE "default",
"middle_nm" varchar(100) COLLATE "default",
"last_nm" varchar(100) COLLATE "default",
"alt_nm" varchar(200) COLLATE "default" NOT NULL,
"index_nm" varchar(200) COLLATE "default",
"sleep_flg" varchar(3) COLLATE "default" DEFAULT '0'::character varying NOT NULL,
"secret_flg" varchar(3) COLLATE "default" DEFAULT '0'::character varying NOT NULL,
"gender" varchar(3) COLLATE "default" DEFAULT '0'::character varying NOT NULL,
"birthday" date,
"birthday_lunary" int2,
"birthday_lunarm" int2,
"birthday_lunard" int2,
"memo" varchar(4000) COLLATE "default",
"create_typ" varchar(3) COLLATE "default" NOT NULL,
"created_by_uid" varchar(40) COLLATE "default",
"created_date" timestamp(3),
"created_by" varchar(50) COLLATE "default",
"created_by_cd" varchar(100) COLLATE "default",
"created_unit_cd" varchar(50) COLLATE "default",
"modified_by_uid" varchar(40) COLLATE "default",
"modified_date" timestamp(3),
"modified_by" varchar(50) COLLATE "default",
"modified_by_cd" varchar(100) COLLATE "default",
"modified_unit_cd" varchar(50) COLLATE "default",
"version" int4,
"unitcd_ou" varchar(100) COLLATE "default",
"language_id" int4,
"title_id" int4,
"country_id" int4,
"province_id" int4,
"city_id" int4,
"rcountry_id" int4,
"rprovince_id" int4,
"rcity_id" int4,
"nation_id" int4,
"occupation_id" int4,
"education_id" int4,
"created_unit_uid" varchar(40) COLLATE "default",
"modified_unit_uid" varchar(40) COLLATE "default"
)
WITH (OIDS=FALSE)

;
COMMENT ON TABLE "grp_dev"."grp_crm_profile" IS '用于记录客人姓名等基本信息，也是客史类数据表的主表。';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."id" IS 'ID字段';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."chain_uid" IS '集团CD';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."profile_no" IS '客史号';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."status_flg" IS '状态标识 1：有效（默认）0：无效';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."profile_typ" IS '客户类型 0-临时 1-永久';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."first_nm" IS '姓 拼音姓';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."middle_nm" IS '中间名';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."last_nm" IS '名 拼音名';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."alt_nm" IS '姓名/别名 中文姓名';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."index_nm" IS '姓名关键字 为姓名查询进行冗余 英文名/拼音+中文名';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."sleep_flg" IS '休眠标识 0：正常（默认）1：休眠';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."secret_flg" IS '保密标识 0：不保密（默认）1：保密';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."gender" IS '性别 M：男 F：女 *：保密';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."birthday" IS '生日';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."birthday_lunary" IS '农历生日年';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."birthday_lunarm" IS '农历生日月';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."birthday_lunard" IS '农历生日日';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."memo" IS '备注';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."create_typ" IS '建立方式 1：酒店 2：网站 3：线下会员系统 4：CRS';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."created_by_uid" IS '创建人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."created_date" IS '创建日';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."created_by" IS '创建人';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."created_by_cd" IS '创建人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."created_unit_cd" IS '创建人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."modified_by_uid" IS '修改人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."modified_date" IS '修改日';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."modified_by" IS '修改人';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."modified_by_cd" IS '修改人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."modified_unit_cd" IS '修改人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."version" IS '版本';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."unitcd_ou" IS '版本区分';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."language_id" IS '语言';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."title_id" IS '称谓';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."country_id" IS '国籍';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."province_id" IS '户籍省';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."city_id" IS '户籍市';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."rcountry_id" IS '常驻国籍';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."rprovince_id" IS '常驻省';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."rcity_id" IS '常驻市';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."nation_id" IS '民族';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."occupation_id" IS '职业';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."education_id" IS '教育程度';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."created_unit_uid" IS '创建人单位ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile"."modified_unit_uid" IS '修改人单位ID';

