-- ----------------------------
-- Table structure for grp_crm_profile_address
-- ----------------------------
DROP TABLE IF EXISTS "grp_dev"."grp_crm_profile_address";
CREATE TABLE "grp_dev"."grp_crm_profile_address" (
"id" int4 DEFAULT nextval('"grp_dev".crm_profile_address_id_seq'::regclass) NOT NULL,
"chain_uid" varchar(40) COLLATE "default" NOT NULL,
"profile_no" varchar(40) COLLATE "default" NOT NULL,
"status_flg" varchar(3) COLLATE "default" DEFAULT '1'::character varying NOT NULL,
"address_flg" varchar(3) COLLATE "default" NOT NULL,
"address1" varchar(200) COLLATE "default" NOT NULL,
"address2" varchar(200) COLLATE "default",
"address3" varchar(200) COLLATE "default",
"country_id" int4,
"province_id" int4,
"city_id" int4,
"zone_no" varchar(40) COLLATE "default",
"post_no" varchar(40) COLLATE "default",
"default_flg" varchar(3) COLLATE "default" NOT NULL,
"create_typ" varchar(3) COLLATE "default" NOT NULL,
"created_by_uid" varchar(40) COLLATE "default",
"created_date" timestamp(3),
"created_by" varchar(50) COLLATE "default",
"created_by_cd" varchar(100) COLLATE "default",
"created_unit_cd" varchar(50) COLLATE "default",
"created_unit_uid" varchar(40) COLLATE "default",
"modified_by_uid" varchar(40) COLLATE "default",
"modified_date" timestamp(3),
"modified_by" varchar(50) COLLATE "default",
"modified_by_cd" varchar(100) COLLATE "default",
"modified_unit_cd" varchar(50) COLLATE "default",
"modified_unit_uid" varchar(40) COLLATE "default",
"version" int4,
"common_flg" varchar(3) COLLATE "default"
)
WITH (OIDS=FALSE)

;
COMMENT ON TABLE "grp_dev"."grp_crm_profile_address" IS '用于记录客人家庭地址、工作地址等，是客史基本资料表的子表。';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."id" IS 'ID字段';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."chain_uid" IS '集团CD';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."profile_no" IS '客史号';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."status_flg" IS '状态标识 1：有效（默认）0：无效';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."address_flg" IS '地址类型 0：家庭住址 1：工作地址 3：户籍地址';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."address1" IS '地址1';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."address2" IS '地址2';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."address3" IS '地址3';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."country_id" IS '国家';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."province_id" IS '省';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."city_id" IS '市';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."zone_no" IS '城区';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."post_no" IS '邮编';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."default_flg" IS '是否默认 0：非默认 1：默认';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."create_typ" IS '建立方式 1：酒店 2：网站 3：线下会员系统 4：CRS';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."created_by_uid" IS '创建人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."created_date" IS '创建日';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."created_by" IS '创建人';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."created_by_cd" IS '创建人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."created_unit_cd" IS '创建人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."created_unit_uid" IS '创建人单位KEY';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."modified_by_uid" IS '修改人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."modified_date" IS '修改日';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."modified_by" IS '修改人';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."modified_by_cd" IS '修改人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."modified_unit_cd" IS '修改人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."modified_unit_uid" IS '修改人单位KEY';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_address"."version" IS '版本';

