;
COMMENT ON TABLE "grp_dev"."grp_crm_profile_blacklist" IS '用于记录客人是否为黑名单或通缉犯，是客史基本资料表的子表。';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_blacklist"."id" IS 'ID字段';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_blacklist"."chain_uid" IS '集团CD';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_blacklist"."profile_no" IS '客史号';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_blacklist"."status_flg" IS '状态标识1：有效（默认） 0：无效/撤销';
