COMMENT ON COLUMN "grp_dev"."grp_crm_profile_blacklist"."created_date" IS '创建日';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_blacklist"."created_by" IS '创建人';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_blacklist"."created_by_cd" IS '创建人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_blacklist"."created_unit_cd" IS '创建人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_blacklist"."created_unit_uid" IS '创建人单位KEY';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_blacklist"."modified_by_uid" IS '修改人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_blacklist"."modified_date" IS '修改日';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_blacklist"."modified_by" IS '修改人';
