COMMENT ON COLUMN "grp_dev"."grp_crm_profile_blacklist"."modified_unit_cd" IS '修改人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_blacklist"."modified_unit_uid" IS '修改人单位KEY';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_blacklist"."version" IS '版本';

