-- ----------------------------
-- Table structure for grp_crm_profile_class
-- ----------------------------
DROP TABLE IF EXISTS "grp_dev"."grp_crm_profile_class";
CREATE TABLE "grp_dev"."grp_crm_profile_class" (
"id" int4 DEFAULT nextval('"grp_dev".crm_profile_class_id_seq'::regclass) NOT NULL,
"chain_uid" varchar(40) COLLATE "default" NOT NULL,
"profile_no" varchar(40) COLLATE "default" NOT NULL,
"status_flg" varchar(3) COLLATE "default" DEFAULT '1'::character varying NOT NULL,
"unit_uid" varchar(40) COLLATE "default" NOT NULL,
"note" varchar(500) COLLATE "default",
"created_by_uid" varchar(40) COLLATE "default",
"created_date" timestamp(3),
"created_by" varchar(50) COLLATE "default",
"created_by_cd" varchar(100) COLLATE "default",
"created_unit_cd" varchar(50) COLLATE "default",
"modified_by_uid" varchar(40) COLLATE "default",
"modified_date" timestamp(3),
"modified_by" varchar(50) COLLATE "default",
"modified_by_cd" varchar(100) COLLATE "default",
"modified_unit_cd" varchar(50) COLLATE "default",
"version" int4,
"prfcls_id" int4,
"prfsubcls_id" int4,
"vip_id" int4,
"created_unit_uid" varchar(40) COLLATE "default",
"modified_unit_uid" varchar(40) COLLATE "default",
"create_typ" varchar(3) COLLATE "default" NOT NULL
)
WITH (OIDS=FALSE)

;
COMMENT ON TABLE "grp_dev"."grp_crm_profile_class" IS '用于记录客人在集团和各酒店属于不同的分类，是客史基本资料表的子表。';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."id" IS 'ID字段';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."chain_uid" IS '集团CD';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."profile_no" IS '客史号';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."status_flg" IS '状态标识 1：有效（默认）0：无效';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."unit_uid" IS '所属单位';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."note" IS '注释';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."created_by_uid" IS '创建人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."created_date" IS '创建日';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."created_by" IS '创建人';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."created_by_cd" IS '创建人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."created_unit_cd" IS '创建人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."modified_by_uid" IS '修改人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."modified_date" IS '修改日';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."modified_by" IS '修改人';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."modified_by_cd" IS '修改人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."modified_unit_cd" IS '修改人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."version" IS '版本';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."prfcls_id" IS '客史分类';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."prfsubcls_id" IS '贵宾等级';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."vip_id" IS '贵宾等级';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."created_unit_uid" IS '创建人单位ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_class"."modified_unit_uid" IS '修改人单位ID';

