DROP TABLE IF EXISTS "grp_dev"."grp_crm_profile_company";
CREATE TABLE "grp_dev"."grp_crm_profile_company" (
"id" int4 DEFAULT nextval('"grp_dev".crm_profile_company_id_seq'::regclass) NOT NULL,
"chain_uid" varchar(40) COLLATE "default" NOT NULL,
"profile_no" varchar(40) COLLATE "default" NOT NULL,
"status_flg" varchar(3) COLLATE "default" DEFAULT '1'::character varying NOT NULL,
"work_comp" varchar(40) COLLATE "default",
"contract_comp" varchar(40) COLLATE "default",
"department" varchar(100) COLLATE "default",
"worktitle_id" int4 DEFAULT 0,
"position_id" int4 DEFAULT 0,
"default_flg" varchar(3) COLLATE "default" NOT NULL,
"create_typ" varchar(3) COLLATE "default" NOT NULL,
"created_by_uid" varchar(40) COLLATE "default",
"created_date" timestamp(3),
"created_by" varchar(50) COLLATE "default",
"created_by_cd" varchar(100) COLLATE "default",
"created_unit_cd" varchar(50) COLLATE "default",
"created_unit_uid" varchar(40) COLLATE "default" DEFAULT 0,
"modified_by_uid" varchar(40) COLLATE "default",
"modified_date" timestamp(3),
"modified_by" varchar(50) COLLATE "default",
"modified_by_cd" varchar(100) COLLATE "default",
"modified_unit_cd" varchar(50) COLLATE "default",
"modified_unit_uid" varchar(40) COLLATE "default" DEFAULT 0,
"version" int4
)
WITH (OIDS=FALSE)

;
COMMENT ON TABLE "grp_dev"."grp_crm_profile_company" IS '用于记录客人所属协议公司或工作公司，是客史基本资料表的子表。';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."id" IS 'ID字段';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."chain_uid" IS '集团CD';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."profile_no" IS '客史号';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."status_flg" IS '状态标识 1：有效（默认）0：无效';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."work_comp" IS '工作公司';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."contract_comp" IS '协议公司';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."department" IS '部门';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."worktitle_id" IS '职务';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."position_id" IS '职位';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."default_flg" IS '是否默认 0：非默认 1：默认';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."create_typ" IS '建立方式 1：酒店 2：网站 3：线下会员系统 4：CRS';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."created_by_uid" IS '创建人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."created_date" IS '创建日';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."created_by" IS '创建人';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."created_by_cd" IS '创建人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."created_unit_cd" IS '创建人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."created_unit_uid" IS '创建人单位KEY';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."modified_by_uid" IS '修改人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."modified_date" IS '修改日';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."modified_by" IS '修改人';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."modified_by_cd" IS '修改人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."modified_unit_cd" IS '修改人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."modified_unit_uid" IS '修改人单位KEY';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_company"."version" IS '版本';

