-- ----------------------------
-- Table structure for grp_crm_profile_contactway
-- ----------------------------
DROP TABLE IF EXISTS "grp_dev"."grp_crm_profile_contactway";
CREATE TABLE "grp_dev"."grp_crm_profile_contactway" (
"id" int4 DEFAULT nextval('"grp_dev".crm_profile_contactway_id_seq'::regclass) NOT NULL,
"chain_uid" varchar(40) COLLATE "default" NOT NULL,
"profile_no" varchar(40) COLLATE "default" NOT NULL,
"status_flg" varchar(3) COLLATE "default" DEFAULT '1'::character varying NOT NULL,
"contacttyp_id" int4 NOT NULL,
"contact_flg" varchar(3) COLLATE "default" NOT NULL,
"receipt_flg" varchar(3) COLLATE "default" NOT NULL,
"country_id" int4,
"zone_no" varchar(40) COLLATE "default",
"contact_ctno" varchar(500) COLLATE "default" NOT NULL,
"note" varchar(500) COLLATE "default",
"default_flg" varchar(3) COLLATE "default" NOT NULL,
"create_typ" varchar(3) COLLATE "default" NOT NULL,
"created_by_uid" varchar(40) COLLATE "default",
"created_date" timestamp(3),
"created_by" varchar(50) COLLATE "default",
"created_by_cd" varchar(100) COLLATE "default",
"created_unit_cd" varchar(50) COLLATE "default",
"created_unit_uid" varchar(40) COLLATE "default",
"modified_by_uid" varchar(40) COLLATE "default",
"modified_date" timestamp(3),
"modified_by" varchar(50) COLLATE "default",
"modified_by_cd" varchar(100) COLLATE "default",
"modified_unit_cd" varchar(50) COLLATE "default",
"modified_unit_uid" varchar(40) COLLATE "default",
"version" int4
)
WITH (OIDS=FALSE)

;
COMMENT ON TABLE "grp_dev"."grp_crm_profile_contactway" IS '用于记录客人手机、信箱等联系方式，是客史基本资料表的子表。';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."id" IS 'ID字段';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."chain_uid" IS '集团CD';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."profile_no" IS '客史号';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."status_flg" IS '状态标识 1：有效（默认）0：无效';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."contacttyp_id" IS '联系方式';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."contact_flg" IS '联系方式类型 0：私人 1：工作';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."receipt_flg" IS '通知接收类型 0：全部 1：营销类 2：服务类 9：免扰';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."country_id" IS '国家';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."zone_no" IS '区号';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."contact_ctno" IS '联系号码';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."note" IS '说明';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."default_flg" IS '是否默认 0：非默认 1：默认';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."create_typ" IS '建立方式 1：酒店 2：网站 3：线下会员系统 4：CRS';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."created_by_uid" IS '创建人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."created_date" IS '创建日';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."created_by" IS '创建人';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."created_by_cd" IS '创建人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."created_unit_cd" IS '创建人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."created_unit_uid" IS '创建人单位KEY';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."modified_by_uid" IS '修改人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."modified_date" IS '修改日';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."modified_by" IS '修改人';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."modified_by_cd" IS '修改人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."modified_unit_cd" IS '修改人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."modified_unit_uid" IS '修改人单位KEY';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_contactway"."version" IS '版本';

