-- ----------------------------
-- Table structure for grp_crm_profile_notice
-- ----------------------------
DROP TABLE IF EXISTS "grp_dev"."grp_crm_profile_notice";
CREATE TABLE "grp_dev"."grp_crm_profile_notice" (
"id" int4 DEFAULT nextval('"grp_dev".crm_profile_notice_id_seq'::regclass) NOT NULL,
"chain_uid" varchar(40) COLLATE "default" NOT NULL,
"profile_no" varchar(40) COLLATE "default" NOT NULL,
"status_flg" varchar(3) COLLATE "default" DEFAULT '1'::character varying NOT NULL,
"unit_uid" varchar(40) COLLATE "default",
"notice_flg" varchar(3) COLLATE "default" NOT NULL,
"notice_title" varchar(100) COLLATE "default",
"postyp_id" int4,
"memo" varchar(4000) COLLATE "default" NOT NULL,
"default_flg" varchar(3) COLLATE "default" NOT NULL,
"created_by_uid" varchar(40) COLLATE "default",
"created_date" timestamp(3),
"created_by" varchar(50) COLLATE "default",
"created_by_cd" varchar(100) COLLATE "default",
"created_unit_cd" varchar(50) COLLATE "default",
"created_unit_uid" varchar(40) COLLATE "default",
"modified_by_uid" varchar(40) COLLATE "default",
"modified_date" timestamp(3),
"modified_by" varchar(50) COLLATE "default",
"modified_by_cd" varchar(100) COLLATE "default",
"modified_unit_cd" varchar(50) COLLATE "default",
"modified_unit_uid" varchar(40) COLLATE "default",
"version" int4,
"create_typ" varchar(3) COLLATE "default" NOT NULL
)
WITH (OIDS=FALSE)

;
COMMENT ON TABLE "grp_dev"."grp_crm_profile_notice" IS '用于记录客人在CRM、前台、销售点等处的备注信息，是客史基本资料表的子表。';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."id" IS 'ID字段';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."chain_uid" IS '集团CD';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."profile_no" IS '客史号';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."status_flg" IS '状态标识 1：有效（默认）0：无效';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."unit_uid" IS '所属单位';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."notice_flg" IS '备注类型';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."notice_title" IS '备注标题';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."postyp_id" IS '销售点属性';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."memo" IS '内容  0：ALL  1：预订备注  2：前台备注  3：客房备注  4：收银备注  5：销售点备注  ';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."default_flg" IS '是否默认 0：非默认 1：默认';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."created_by_uid" IS '创建人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."created_date" IS '创建日';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."created_by" IS '创建人';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."created_by_cd" IS '创建人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."created_unit_cd" IS '创建人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."created_unit_uid" IS '创建人单位KEY';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."modified_by_uid" IS '修改人ID';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."modified_date" IS '修改日';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."modified_by" IS '修改人';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."modified_by_cd" IS '修改人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."modified_unit_cd" IS '修改人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."modified_unit_uid" IS '修改人单位KEY';
COMMENT ON COLUMN "grp_dev"."grp_crm_profile_notice"."version" IS '版本';

