DROP TABLE IF EXISTS "grp_dev"."grp_crs_roomtype";
CREATE TABLE "grp_dev"."grp_crs_roomtype" (
"id" int4 DEFAULT nextval('"grp_dev".grp_crs_roomtype_id_seq'::regclass) NOT NULL,
"chain_uid" varchar(40) COLLATE "default" NOT NULL,
"status_flg" varchar(3) COLLATE "default" NOT NULL,
"roomtyp_id" int4 NOT NULL,
"roomtyp_cd" varchar(20) COLLATE "default" DEFAULT NULL::character varying,
"roomtyp_nm" varchar(200) COLLATE "default" NOT NULL,
"seq" int4,
"pseudo_flg" varchar(3) COLLATE "default" NOT NULL,
"combination_flg" varchar(3) COLLATE "default" DEFAULT NULL::character varying,
"meetingroom_flg" varchar(3) COLLATE "default" DEFAULT NULL::character varying,
"suit_flg" varchar(3) COLLATE "default" NOT NULL,
"shareable_flg" varchar(3) COLLATE "default" NOT NULL,
"note" varchar(500) COLLATE "default" DEFAULT NULL::character varying,
"created_by_uid" varchar(40) COLLATE "default",
"created_date" timestamp(3),
"created_by" varchar(50) COLLATE "default",
"created_by_cd" varchar(100) COLLATE "default",
"created_unit_cd" varchar(50) COLLATE "default",
"created_unit_uid" varchar(40) COLLATE "default",
"modified_by_uid" varchar(40) COLLATE "default",
"modified_date" timestamp(3),
"modified_by" varchar(50) COLLATE "default",
"modified_by_cd" varchar(100) COLLATE "default",
"modified_unit_cd" varchar(50) COLLATE "default",
"modified_unit_uid" varchar(40) COLLATE "default",
"version" int4
)
WITH (OIDS=FALSE)

;
COMMENT ON TABLE "grp_dev"."grp_crs_roomtype" IS '房型配置';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."id" IS 'ID ID字段';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."chain_uid" IS '集团代码 ';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."status_flg" IS '状态标识 1：有效（默认）
0：无效';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."roomtyp_id" IS '房型代码 ';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."roomtyp_cd" IS '房型编码 ';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."roomtyp_nm" IS '房型名称 ';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."seq" IS '序号 ';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."pseudo_flg" IS '假房标志 0：真房（默认）
1：假房';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."combination_flg" IS '组合房标志 0：非组合房（默认）
1：组合房';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."meetingroom_flg" IS '会议室标志 0：非会议室（默认）
1：会议室';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."suit_flg" IS '套房标识 0：非套房（默认），1：套房';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."shareable_flg" IS '连通房标识 0普通房，1连通房';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."note" IS '备注 ';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."created_by_uid" IS '创建人ID';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."created_date" IS '创建日';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."created_by" IS '创建人';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."created_by_cd" IS '创建人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."created_unit_cd" IS '创建人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."created_unit_uid" IS '创建人单位KEY';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."modified_by_uid" IS '修改人ID';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."modified_date" IS '修改日';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."modified_by" IS '修改人';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."modified_by_cd" IS '修改人CODE';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."modified_unit_cd" IS '修改人单位CODE';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."modified_unit_uid" IS '修改人单位KEY';
COMMENT ON COLUMN "grp_dev"."grp_crs_roomtype"."version" IS '版本';

